/**
 * 효율적인 화폐구성
 *  n = 화폐의 종류(1 <= n <= 100)
 *  m = 가치의 합(1 <= m <= 10,000)
 */
[n, m], 3, 5, 7;
function currencyComposition(nm, ...currency) {
  const [n, m] = nm;

  console.log(n, m, currency);
  return;
}

export default { currencyComposition };
